import React, { useState } from 'react';

const API_BASE_URL = 'http://localhost:5000/api';

const App = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [recipes, setRecipes] = useState([]);
  const [extractedIngredients, setExtractedIngredients] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Handle file selection
  const handleFileChange = (event) => {
    setSelectedFile(event.target.files[0]);
    // Reset UI on new file selection
    setRecipes([]);
    setExtractedIngredients([]);
    setError('');
  };

  // Handle scan button click
  const handleScan = async () => {
    if (!selectedFile) {
      setError('Please select an image to scan.');
      return;
    }

    setLoading(true);
    setError('');

    const formData = new FormData();
    formData.append('receipt', selectedFile);

    try {
      // IMPORTANT: This fetch call requires a separate backend server to work.
      // It sends the image to the backend which then handles the API calls securely.
      const response = await fetch(`${API_BASE_URL}/scan-receipt`, {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      const data = await response.json();
      
      setExtractedIngredients(data.extractedIngredients);
      setRecipes(data.recipes);

    } catch (error) {
      console.error('There was a problem with the fetch operation:', error);
      setError('Failed to process the image. Please ensure the backend server is running.');
    } finally {
      setLoading(false);
    }
  };

  // Recipe Card Component
  const RecipeCard = ({ recipe }) => (
    <div className="bg-gray-50 rounded-xl overflow-hidden shadow-md flex flex-col transition-transform duration-200 hover:-translate-y-1 hover:shadow-lg">
      <img src={recipe.image} alt={recipe.title} className="w-full h-48 object-cover" />
      <div className="p-4 flex-grow flex flex-col justify-between">
        <div>
          <h3 className="text-lg font-bold mb-2 text-gray-800">{recipe.title}</h3>
          <p className="text-sm text-gray-600">
            Used Ingredients: <span className="font-semibold">{recipe.usedIngredientCount}</span>
          </p>
        </div>
      </div>
    </div>
  );

  return (
    <div className="bg-gray-100 min-h-screen py-8">
      <div className="main-container max-w-4xl mx-auto p-8 rounded-2xl shadow-xl bg-white">
        <header className="mb-8 text-center">
          <h1 className="text-4xl font-extrabold text-green-700 mb-2">Recipe Scanner</h1>
          <p className="text-lg text-gray-600">Upload a picture of a receipt or ingredient list to get recipe ideas!</p>
        </header>

        <section className="scan-section mb-8">
          <div className="flex flex-col items-center justify-center space-y-4">
            <input
              type="file"
              id="fileInput"
              accept="image/*"
              onChange={handleFileChange}
              className="file-input block w-full text-sm text-gray-500
              file:mr-4 file:py-2 file:px-4
              file:rounded-full file:border-0
              file:text-sm file:font-semibold
              file:bg-green-50 file:text-green-700
              hover:file:bg-green-100"
            />
            <button
              onClick={handleScan}
              disabled={loading || !selectedFile}
              className="bg-green-600 text-white font-bold py-3 px-8 rounded-full shadow-lg hover:bg-green-700 transition-colors duration-300 disabled:bg-gray-400 disabled:cursor-not-allowed"
            >
              {loading ? 'Scanning...' : 'Scan Image'}
            </button>
          </div>
        </section>

        {loading && (
          <div className="text-center">
            <div className="loading-spinner"></div>
            <p className="text-gray-500 mt-2">Scanning and fetching recipes...</p>
          </div>
        )}

        {error && (
          <div className="bg-red-100 text-red-700 p-4 rounded-lg mt-4 text-left font-medium">
            {error}
          </div>
        )}
        
        {recipes.length > 0 && (
          <section className="mt-8">
            <h2 className="text-2xl font-bold text-gray-700 mb-4 text-left">Extracted Ingredients:</h2>
            <ul className="list-disc list-inside space-y-1 mb-8 text-gray-600 text-left">
              {extractedIngredients.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>

            <h2 className="text-2xl font-bold text-gray-700 mb-4 text-left">Suggested Recipes:</h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
              {recipes.map((recipe) => (
                <RecipeCard key={recipe.id} recipe={recipe} />
              ))}
            </div>
          </section>
        )}
      </div>
    </div>
  );
};

export default App;
